import './App.css';

const Person = (props) =>{
  return(
    <>
    <h2>First Name: {props.name}</h2>
    <h2>Last Name: {props.last_name}</h2>
    <h2>Age: {props.age}</h2>
    </>
  )
}

const App = () => {
  return (
    <div className="App">
      <Person name = 'Hugo' last_name = 'Salcedo' age = '25'/>
      <Person name = 'Martin' last_name = 'Morales' age = '63'/>
      <Person name = 'Matias' last_name = 'Perez' age = '8'/>
    </div>
  );
}

export default App;
